def getallfundcode():
    webdoc = urlopen("http://fund.eastmoney.com/Data/FundDataPortfolio_interface.aspx?dt=14&mc=returnjson&ft=all&pn=5000&pi=1&sc=abbname&st=asc")
    webdoc = webdoc.read()
    webdoc = webdoc[16:].decode('utf-8')
    webdoc = webdoc[6:-31]
    jsonobj = json.loads(webdoc)

    fundids = []
    for obj in jsonobj:
        ids = obj[4].split(',')
        fundids += ids
    fundids = set(fundids)
    return fundids
    
