def initdf():
    colname = ['_$', '$_pct', '_$_pct', '$_rate', '$_class']
    w_col = list(map(lambda x: x.replace('$', 'w'), colname))
    m_col = list(map(lambda x: x.replace('$', 'm'), colname))
    m3_col = list(map(lambda x: x.replace('$', 'm3'), colname))
    m6_col = list(map(lambda x: x.replace('$', 'm6'), colname))
    y_col = list(map(lambda x: x.replace('$', 'y'), colname))
    y2_col = list(map(lambda x: x.replace('$', 'y2'), colname))
    y3_col = list(map(lambda x: x.replace('$', 'y3'), colname))
    y5_col = list(map(lambda x: x.replace('$', 'y5'), colname))
    a_col = list(map(lambda x: x.replace('$', 'a'), colname))
    f_col = list(map(lambda x: x.replace('$', 'f'), colname))
    df = pd.DataFrame(columns=["id", 'name']+w_col+m_col+m3_col+m6_col+y_col+y2_col+y3_col+y5_col+a_col+f_col +\
            ['w_rate_1','w_rate_2','m_rate_1','m_rate_2','m3_rate_1','m3_rate_2','m6_rate_1','m6_rate_2',\
            'y_rate_1','y_rate_2','y2_rate_1','y2_rate_2','y3_rate_1','y3_rate_2','y5_rate_1','y5_rate_2',\
            'a_rate_1','a_rate_2','f_rate_1','f_rate_2'])
    return df
    
def addrow(df, l):
    df.loc[len(df)] = l

def getfundinfo(fundid):
    drv = webdriver.PhantomJS()
    url = 'https://m.1234567.com.cn/index.html?page=fundjdsy&fundcode=' + fundid
    drv.get(url)
    
    spans = drv.find_elements_by_tag_name('span')
    tds = drv.find_elements_by_tag_name('td')
    tdtexts = list(map(lambda x: x.text, tds))    
    ret = [spans[2].text, spans[1].text] + tdtexts[:50] + tdtexts[3].split('|') + tdtexts[8].split('|') + tdtexts[13].split('|') + tdtexts[18].split('|') + tdtexts[23].split('|') + tdtexts[28].split('|') + tdtexts[33].split('|') + tdtexts[38].split('|') + tdtexts[43].split('|') + tdtexts[48].split('|')
    
    drv.quit()
    return ret
    
