swap = server.list()
pool = Pool(10)

def worker(id):
    try:
        swap.append(getfundinfo(id))
        logging.info(id + ' ' + str(len(swap)) + ' / ' + str(fundcount))
    except Exception as e:
        logging.error(e)
        logging.error(id)

pool.map(worker, allfunds)

pool.close()
pool.join()

df = initdf()
for item in swap:
    addrow(df, item)

try:
    df.to_excel('/home/tf/fund/static/top_of_eastmoney/allfunds.xls')
    logging.info('FINISH')
except Exception as e:
    logging.error(e)
    
logging.shutdown()

